% PP方法计算平衡态一维原子链光学电导率 - MATLAB版本
clear;
tic;
% 参数设置
L = 22;          % 原子数
t_h = 1.0;       % 跳跃积分
eta = 1e-5;      % 展宽因子
A_freq = 0;
KuboCal = false;

% 时间参数
Fs = 0.01;            % Sampling frequency
dt = 1/Fs;             % Sampling period
t_steps = 300000;             % Length of signal
t = (0:t_steps-1) * dt;        % Time vector
t_max = (t_steps-1) * dt;

% 探针脉冲参数
A_t = (1.0e-2) * cos(2 * pi * A_freq * t); % 阶跃型矢量势幅度
% A_t = 1e5/(0.4*sqrt(2*pi))*(exp(-t.^2/(2*(0.1*1)^2)));

t_probe = 0.0;    % 探针施加时间
A_t(t < t_probe) = 0;
% 只取正频率部分
% refered to the help file in fft
positive_freqs = Fs/t_steps * (0:(t_steps/2));
% 计算矢量势的傅里叶变换
figure  %[output:6bfc8268]
subplot(1,2,1) %[output:6bfc8268]
A_t_fft = fft(A_t)/t_steps;
A_probe_positive = abs(A_t_fft(1:t_steps/2+1));
A_probe_positive(2:end-1) = 2 * A_probe_positive(2:end-1);
plot(positive_freqs, abs(A_probe_positive),'LineWidth',2,'DisplayName','unwindowed') %[output:6bfc8268]
hold on %[output:6bfc8268]

window_decay = exp(-eta * t);  % 指数衰减窗函数
A_t_windowed = A_t .* window_decay;
A_t_fft = fft(A_t_windowed)/t_steps;
A_probe_positive = abs(A_t_fft(1:t_steps/2+1));
A_probe_positive(2:end-1) = 2 * A_probe_positive(2:end-1);

plot(positive_freqs, abs(A_probe_positive),'LineWidth',2,'DisplayName','windowed') %[output:6bfc8268]
xlabel('\omega') %[output:6bfc8268]
ylabel('A(\omega)') %[output:6bfc8268]
% yscale log

%% 主程序开始
fprintf('开始计算...\n'); %[output:6be3f89d]

% 初始化系统
H0 = build_H0(L, t_h);
[eigvecs, eigvals] = eig(H0);
eigvals = diag(eigvals);
subplot(1,2,2) %[output:6bfc8268]

plot(eigvals,'.','MarkerSize',10); %[output:6bfc8268]
ylabel('E') %[output:6bfc8268]
xlabel('N') %[output:6bfc8268]
hold on %[output:6bfc8268]
title('Eigenvalue') %[output:6bfc8268]
SelectState = 1; %[control:editfield:230e]{"position":[15,16]}
plot(SelectState, eigvals(SelectState),'+','MarkerSize',10,'LineWidth',3); %[output:6bfc8268]

psi = eigvecs(:, SelectState);  % 基态
h = findall(gcf,'Type','axes');
set(h, 'FontSize', 16, 'linewidth',1.5);  %[output:6bfc8268]

% 有探针的时间演化
psi_probe = psi;
j_total = zeros(1, t_steps);

for ii = 1:t_steps %[output:group:95265a40]
    t_current = t(ii);

    % 显示进度
    if mod(ii, t_max/(10*dt)) == 0
        fprintf('有探针演化进度: %d/%d\n', ii, t_steps); %[output:33176e53]
    end

    % 施加阶跃型矢量势
    A_now = A_t(ii);

    % 含Peierls相位的哈密顿量
    H_A = build_H_with_A(L, A_now, t_h);
    psi_probe = time_evolve(psi_probe, H_A, dt);

    % 计算电流期望值
    J_op = build_current_operator(L, t_h, A_now);
    j_total(ii) = psi_probe' * J_op * psi_probe;
end %[output:group:95265a40]

% 计算探针引起的电流
j_probe = j_total;

% 傅里叶变换得到频率空间电流

j_probe_windowed = j_probe .* window_decay;

j_probe_fft = fft(j_probe_windowed);


j_probe_norm = abs(j_probe_fft/t_steps);
j_probe_positive = j_probe_norm(1:t_steps/2+1);
j_probe_positive(2:end-1) = 2 * j_probe_positive(2:end-1);
j_probe_phase = abs(j_probe_fft/t_steps);

% 计算光学电导率
sigma_pp = j_probe_positive ./ (1i * (positive_freqs + 1i * eta) .* A_probe_positive);


sigma = -real(sigma_pp);

disp(['Number density: ',num2str(psi'*psi)]) %[output:8ba7b49f]
disp(['Integral result: ',num2str(trapz(positive_freqs,sigma))]) %[output:419a3a8d]
% PP方法结果
figure %[output:6f152bb6]
plot(positive_freqs, sigma, 'b-', 'LineWidth', 2, 'DisplayName', 'ED method'); %[output:6f152bb6]
xlabel('\omega'); %[output:6f152bb6]
ylabel('Re \sigma(\omega)'); %[output:6f152bb6]
title('Optical Conductivity via ED Method'); %[output:6f152bb6]
legend; %[output:6f152bb6]
grid on; %[output:6f152bb6]
alpha(0.3);
% xlim([0, 1]);
ylim([0,max(sigma)]) %[output:6f152bb6]

set(gca,'fontsize',14) %[output:6f152bb6]
set(gca,'LineWidth',1) %[output:6f152bb6]

if KuboCal
    % 使用Kubo公式计算作为对比
    fprintf('计算Kubo公式结果...\n');
    J_op_kubo = build_current_operator(L, t_h,0);
    omega_range = positive_freqs(positive_freqs > 0);
    sigma_kubo_vals = zeros(size(omega_range));

    for idx = 1:length(omega_range)
        omega = omega_range(idx);
        sigma_kubo_vals(idx) = sigma_kubo(L, omega, eta, eigvals, eigvecs, J_op_kubo);

        if mod(idx, 2000) == 0
            fprintf('Kubo计算进度: %d/%d\n', idx, length(omega_range));
        end
    end
end
%% 绘图
figure('Position', [100, 100, 1200, 800]);
%%


toc; %[output:90b1ea25]

if KuboCal
    % Kubo公式结果
    figure
    plot(omega_range, sigma_kubo_vals, 'r-', 'LineWidth', 1.5, 'DisplayName', 'Kubo formula');
    xlabel('\omega');
    ylabel('Re \sigma(\omega)');
    title('Optical Conductivity via Kubo Formula');
    legend;
    grid on;
    alpha(0.3);
    xlim([0, 20]);

    % 比较两种方法
    figure('Position', [100, 100, 800, 600]);
    common_freqs = positive_freqs(positive_freqs > 0.1 & positive_freqs < 20);
    sigma_pp_common = real(sigma_pp(positive_freqs > 0.1 & positive_freqs < 20));

    plot(common_freqs, sigma_pp_common, 'b-', 'LineWidth', 2, 'DisplayName', 'PP-step');
    hold on;
    plot(omega_range, sigma_kubo_vals, 'r--', 'LineWidth', 2, 'DisplayName', 'Kubo formula');
    xlabel('\omega');
    ylabel('Re \sigma(\omega)');
    title('Comparison of PP-step and Kubo Methods');
    legend;
    grid on;
    alpha(0.3);

    % 绘制电流随时间变化
    figure('Position', [100, 100, 800, 400]);
    plot(t, real(j_probe), 'r-', 'LineWidth', 2);
    xlabel('Time');
    ylabel('Probe-induced Current');
    title('Probe Current Response');
    grid on;

    fprintf('计算完成！\n');
end
