%[text] ## 辅助函数部分
% 构建单粒子哈密顿量
function H0 = build_H0(L, t)
H0 = -t * diag(ones(1,L-1),1) - t * diag(ones(1,L-1),-1);
% H0 = H0 + 2 * diag(rand(L,1) - 0.5);
% 二能带
H0 = H0 + 0 * diag(repmat([1,-1],[1,L/2]));
% PBC
H0(1, end) = -t;
H0(end, 1) = -t;
end

% 含Peierls相位的哈密顿量
function H_A = build_H_with_A(L, A_t, t)

%[text] $H\\left\\lbrack A\\left(t\\right)\\right\\rbrack =-t\\sum\_{i\\;} a\_i^{\\dagger\\;} a\_{i+1} \\;e^{\\textrm{iA}\\left(t\\right)} +a\_{i+1}^{\\dagger\\;} a\_i e^{-\\textrm{iA}\\left(t\\right)}${"editStyle":"visual"}
H_A = -t *exp(1i * A_t) * diag(ones(1,L-1),1);
% H_A(1, end) = -t * exp(-1i * A_t);
H_A = H_A + H_A';

end

% 电流算符
function J = build_current_operator(L, A_t, t)
J = exp(1i * A_t) * diag(ones(1,L-1),1);
J(1, end) = exp(-1i * A_t);
J = J - J';
J = 1i * (-t) * J;
end

%% 时间演化算符
function psi_new = time_evolve(psi, H, dt)
U = expm(-1i * H * dt);
psi_new = U * psi;
end


% Kubo公式计算光学电导率
function sigma_val = sigma_kubo(L, omega, eta, eigvals, eigvecs, J_op)
n = length(eigvals);
sigma_val = 0;

for m = 1:n
    for n_prime = 1:n
        if m == n_prime
            continue;
        end
        j_mn = eigvecs(:, m)' * J_op * eigvecs(:, n_prime);
        energy_diff = eigvals(m) - eigvals(n_prime);
        term = abs(j_mn)^2 * (1/(omega - energy_diff + 1i*eta) - 1/(omega + energy_diff + 1i*eta));
        sigma_val = sigma_val + term;
    end
end

sigma_val = imag(sigma_val) / (omega * L);
end


